import React from "react";
import styles from "./Navbar.module.css";

function Navbar() {
  return (
    <div className={styles.Navbar}>
      <div className={styles.left}>Левый</div>
      <div className={styles.center}>Центр</div>
      <div className={styles.right}>Правый</div>
    </div>
  );
}

export default Navbar;
